script: |
  super -f text -I q6789.spq | sort > q6789.out

inputs:
  - name: q6789.spq
    data: |
      SELECT col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT + + col1 IN ( + ( + - col2 ) * - col2 + col2 * col1 );
  - name: tab1

outputs:
  - name: q6789.out
    data: |
      51
      85
      91
